            new(EventName.Sunrise, EventNature.Neutral, new() {Mind = new(EventNature.Neutral),Studies = new(EventNature.Neutral),Family = new(EventNature.Neutral),Money = new(EventNature.Neutral),Love = new(EventNature.Neutral),Body = new(EventNature.Neutral)}, @" It has been acknowledged that it is the moment at which the centre of the solar disc rises at the eastern horizon, that marks the sunrise at the particular place. It must also be noted that on account of the refraction of the solar rays, due to the various strata enveloping the earth, the Sun is not really at the horizon where he appears to be so but is really below the horizon by about a few minutes of arc (Rekha). But we can take the apparent time as almost correct and need not worry ourselves with the so called delicate correct time of rising. ", [EventTag.Astronomical,], EventManager.GetEventCalculatorMethod(EventName.Sunrise)),
